import React,{Component} from 'react'

class UserGreeting extends Component{

    constructor(props){
        super(props)
        
        this.state = {
            isLoggedIn : false 
        }
    }

    render(){

        if(this.state.isLoggedIn){
            return(
                <div>Welcome Chandru Angadi</div>
            )
        }
        return(
            <div>
                <div>Welcome Chandru Angadi</div>
                <div>Welcome guest</div>
            </div>
        )
    }
}

export default UserGreeting
